    "seney-national-wildlife-refuge-narrative-report-may-june-july-and-august-1952",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1952.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include haying, fur harvesting, and timber removal. A progress report on field investigations
    and applied research is included. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, violations, and fishing.
    Photographs and N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
